import React from 'react';
import { Parallax, Background } from "react-parallax";
import img from './photo.jpg';


function LandingPage(){
  const insideStyles = {
      background: "solid",
      padding: 20,
      position: "absolute",
      top: "50%",
      left: "50%",
      transform: "translate(-50%,-50%)",
    };

    return (
        <Parallax
          blur={0}
          bgImage={img}
          bgImageAlt="idk"
          strength={900}
          renderLayer={percentage => (
            <div>
              <div
                style={{
                  position: "absolute",
                  background: "white",
                  left: "50%",
                  top: "50%",
                  borderRadius: "5%",
                  transform: "translate(-50%,-50%)",
                  width: percentage * 600,
                  height: percentage * 600,
              }}
            />
            <h1>ANkit banal</h1>
          </div>
        )}
      >
        <div style={{ height: 600 }}>
          <div style={insideStyles}><div className = "profile-detail">
              <h1 className = "hello">HEY FOLKS!</h1>
              <p className='tc f3'>I am <br /><br /><span className='color f1 Shadow'>Ankit Bansal</span></p>
              <p className='profile-description'> Final Year CSE Undergrad at Government Engineering College, Bilaspur. </p>
          </div></div>
        </div>
          </Parallax>
    );
}

export default LandingPage;
